  const {user, users} = useSelector(({user})=>({

    user: user.user,
    users:[
        {user_id: 50,
        user_name:"랭킹1위임"},
        {user_id: 51,
            user_name:"랭킹2위임"},
        {user_id: 52,
                user_name:"랭킹3위임"},
        
    
    ]
  }));
  
  return (
    <RankingList user={user} users={users}/>
  );
};

export default RankingListContainer;
